import s from './Orders.module.css';

const Orders = ({ orderArr, orderNum }) => {

  return (
    <>

      <div className={s.wrap}>
      {
          Object.entries(orderArr).map(([key, value]) =>
            <div className={s.num}>
              <p>№ {key}</p>
              <hr />
              {Object.entries(value).map(([key, { name, price, process }]) =>
                <div>
                  <p>{name}</p>
                  <p>${price}</p>
                  <p>{process}</p>
                </div>
              )}
            </div>
          )}
        <div class="num">

        </div>
        <div class="img"></div>
        <div class="itemName"></div>
        <div class="price"></div>
        <div class="process"></div>
        <div class="totalPrice"></div>
      </div>

      <div className={s.wrap}>
        {
          Object.entries(orderArr).map(([key, value]) =>
            <div>
              <p>№ {key}</p>
              <hr />
              {Object.entries(value).map(([key, { name, price, process }]) =>
                <div>
                  <p>{name}</p>
                  <p>${price}</p>
                  <p>{process}</p>
                </div>
              )}
            </div>
          )}
      </div>
    </>
  );
}

export default Orders;
